import styled from "styled-components";

export const HeadWrapper =styled.div`
    position: relative;
    height: 56px;
    border-bottom : 1px solid #f0f0f0;
`

export const Logo = styled.a`
    position: absolute;
    top:0;
    left:0;
    display: block;
    width:100px;
    height: 56px;
    background:orange;
`
